			if (array_diff($this->modifiedColumns, array(VocabularyPeer::AGENT_ID,VocabularyPeer::NAME,VocabularyPeer::URI,VocabularyPeer::BASE_DOMAIN,VocabularyPeer::TOKEN,VocabularyPeer::LAST_URI_ID,VocabularyPeer::STATUS_ID,VocabularyPeer::LANGUAGE))) {
				return false;
			}

			if ($this->agent_id !== 0) {
				return false;
			}

			if ($this->name !== '') {
				return false;
			}

			if ($this->uri !== '') {
				return false;
			}

			if ($this->base_domain !== '') {
				return false;
			}

			if ($this->token !== '') {
				return false;
			}

			if ($this->last_uri_id !== 1000) {
				return false;
			}

			if ($this->status_id !== 1) {
				return false;
			}

			if ($this->language !== 'en') {
				return false;
			}

		// otherwise, everything was equal, so return TRUE
		return true;
	} // hasOnlyDefaultValues()

